import React, {Component} from "react";
import '../styles/App.css'

export class EquipmentList extends Component {


    
    render() {
        return(
            <div className='equipment_card'>
                {this.props.item.map(el => (
                    <h1>{el.name}</h1>
                ))}
            </div>
        )
    }
}
